function About() {
  return (
    <div className="about-container">
      <p className='font-bold text-3xl'>About</p>
      <h1>
                            Fields of interest
                        </h1>
                        <p>
                            During my time studying my degree, it quickly became clear that my interests were more
                            in the creative and artistic side of
                            computer industry . I found myself drawn to front end design and programming, along with
                            computer grafics.
                            I also gained a lot of interest in data analization and visualisation after implementing a
                            visual solution for a startup last summer.
                        </p>
                    </div>

  );
}

export default About;
